Create View [dbo].[v_OrderClientPrnitRepeate]
as 
select o.ClientId,o.Code,COUNT(*) OCount from [Order] o
join
OrderPrint op
on
op.OrderId = o.Id
join
Printed p
on 
p.Id =op.PrintId
where p.[Type] = 'Client'
group by o.ClientId, o.Code

